کوئی بتائے اس شیطان 😈 لونڈے کی شکل میں کوئی رونق ہے تو جواب اس شیطان 😈 کو بھیج دے۔
یہ بیغرت جان بوجھ کر پنجاب میں حالات خراب کرا رہا ہے اور آئین کی دھچیاں اڑا رہا ہے
